const BASE_URL = 'https://www.random.org/integers/?num=1&min=1&max=10&col=1&base=10&format=plain&rnd=new';

export async function getNumber() {
  const response = await fetch(BASE_URL);
  const responseSecond = await fetch(BASE_URL);
  const number = await response.text();
  const numberSecond = await responseSecond.text();
  console.log(number, nu);
}
